  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '文档id',
  `cid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '栏目id',
  `uid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户id',
  `model` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '模型id',
  `title` varchar(256) NOT NULL DEFAULT '' COMMENT '标题',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `sort` int(11) NOT NULL DEFAULT '100' COMMENT '排序',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '状态',
  `view` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '点击量',
  `trash` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '回收站',
  `image` int(11) unsigned NOT NULL COMMENT '封面图片',
  `tstype` varchar(32) NOT NULL COMMENT '类型',
  `zuozhe` varchar(128) NOT NULL COMMENT '作者',
  `zishu` varchar(128) NOT NULL COMMENT '字数',
  `zhishu` int(128) NOT NULL COMMENT '派单指数',
  `tj` varchar(32) NOT NULL COMMENT '推荐位',
  `desc` varchar(128) NOT NULL COMMENT '小说描述',
  `xstype` varchar(32) NOT NULL COMMENT '小说状态',
  `tips` int(11) unsigned NOT NULL COMMENT '打赏金额',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=249 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='小说模型表';
